import styled from "styled-components";

import { IBenefit } from "src/Interfaces/benefit";
import { BenefitItem } from "./Item";
// import { CouponItem } from "./Item";

interface IProps {
    data: IBenefit[];
}

export const ComponentBenefitList = (props: IProps) => {
    const { data } = props;

    return (
        <StyledContainer>
            {data.map(() => {
                return <BenefitItem data={data} />;
            })}
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
`;
